import Vue from "vue";
import Router from "vue-router";
import Home from "@/views/Home.vue";
import Login from "@/views/users/login"

Vue.use(Router);

let userRouter = new Router({
    mode: "history",
    base: process.env.BASE_URL,
    routes: [
        {
            path: "/",
            name: "Home",
            component: Home,
        },
        {
            path:"/login",
            name:"Login",
            component: Login
        }
    ],
});

export default userRouter;
